import React from "react";
import "../pages/StartPage.css";
import "./CustomizingBox.css";

function CustomizingBox() {
  return (
    <div>
        <div className="TitleDiv">
            <div className="MetaIcon"></div>
            <div className="TitleText">캐릭터 커스터마이징</div>
        </div>
        
        
        <button className="lastBtn">완료</button>
    </div>
  );
}

export default CustomizingBox;
